import './style.css'

import {useState} from 'react'

function App() {
  const [num, setNum] = useState(2)

  function rise() {
    setNum(num + 1)
  }

  return (
    <div className="main">
      <div className="container">
        {/* <MovieList /> */}
        <h1>{num}</h1>
        <button onClick={rise}>Увеличить</button>
      </div>
    </div>
  );
}

export default App;
